const i=JSON.parse('{"key":"v-6ec68310","path":"/tools/ieda-tools/ito.html","title":"iTO-时序优化","lang":"zh-CN","frontmatter":{"title":"iTO-时序优化","order":7},"headers":[{"level":3,"title":"报告输出","slug":"报告输出","link":"#报告输出","children":[]}],"git":{"createdTime":1696672932000,"updatedTime":1719138368000,"contributors":[{"name":"myyerrol","email":"myyerrol@126.com","commits":2},{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":2.4,"words":720},"filePathRelative":"tools/ieda-tools/ito.md","localizedDate":"2023年10月7日","excerpt":"<h1> iTO 功能文档</h1>\\n<blockquote>\\n<h2> 概述</h2>\\n</blockquote>\\n<p>TO的全称为Timing Optimization，时序优化。在该步骤，EDA工具会根据时序约束文件，对芯片进行时序分析，目的是通过单元尺寸调整和插入缓冲器等方法尽可能地修复芯片存在的时序违例。</p>\\n<p>时序违例检查主要包括：</p>\\n<ol>\\n<li>时序设计规则违例（DRV）检查；</li>\\n<li>建立时间违例（Setup）检查；</li>\\n<li>保持时间违例（Hold）检查。</li>\\n</ol>\\n<p>支持功能：</p>\\n<ol>\\n<li>时序设计规则违例（DRV）优化；</li>\\n<li>建立时间违例（Setup）优化；</li>\\n<li>保持时间违例（Hold）优化。</li>\\n</ol>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{i as data};
